import styled from 'styled-components';

export const Container = styled.div`
  background:var(--color-white);
  mar
  display:flex;






  >ul {
    display:flex;
    justify-content:center;
    align-items:center;

    >li {
      display:flex;
      justify-content:center;
      align-items:center;

    }


    > span{

      display:flex;
      justify-content:center;
      align-items:center;


    }

    }

`;


export const IconImage  = styled.img`




`;
